import React from "react";
import about from "../src/images/about.jpg";

export const About =()=>{
    return(
        <>
        
        <div className="container">
              <img src={about} alt="Snow" style={{width:"100%", height:"50%"}} />
       
    
  <div className="centered">Centered</div>
   </div>
        
        </>
    )
    

};

export default About;
